import React from 'react';
import styled from 'styled-components';

import Mamber1 from '../img/man1.jpg';
import Mamber2 from '../img/man2.webp';
import Mamber3 from '../img/woman.webp';
import Mamber4 from '../img/woman2.jpg';


const Illustration = styled.div`
    position:relative;

`

class HeaderBackground extends React.Component{
    render(){
        return(
            <Illustration>
                <img src={Mamber1} alt='man'/>
                <img src={Mamber2} alt='man'/>
                <img src={Mamber3} alt='man'/>
                <img src={Mamber4} alt='man'/>
            </Illustration>

        );
    }
}

export default HeaderBackground;
